import React from 'react';
import './Header.css';

function Header() {

  return (
    <div className="header">    
      <div className="header-logo"><span>Visualizer</span></div>
      <div className='d-flex'>
      <ul>
          <li>Sorting</li>
          <li>Searching</li>
          </ul>  
      </div>
      <div className="header__options"> 
      <div class="custom-control custom-switch">
      <input type="checkbox" className="custom-control-input"/>
      <label className="custom-control-label" for="customSwitches">Dark Mode</label>
</div> 
      </div>
   </div>
  )
}

export default Header;
